    @ColorInt
    fun find(name: String): Int? {
        val index : Int = color_names.binarySearch(name.lowercase(Locale.ROOT))
        if (index >= 0) {
            val found = color_entries[index]
            return Color.rgb(found.red, found.green, found.blue)
        }
        return null
    }
